  "Sanctions" : "IT IS AGREED AND ORDERED, PURSUANT TO RCW 21.20.390, THAT RESPONDENT TERRENCE R. SPRAGUE SHALL CEASE AND DESIST FROM OFFERING AND/OR SELLING SECURITIES IN VIOLATION OF RCW 21.20.702, THE SUITABILITY PROVISION OF THE SECURITIES ACT OF WASHINGTON. IT IS FURTHER AGREED AND ORDERED, PURSUANT TO RCW 21.20.395, THAT RESPONDENT TERRENCE R. SPRAGUE SHALL BE SUBJECT TO A FINE IN THE AMOUNT OF FIFTY THOUSAND DOLLARS ($50,000), WITH THE ENTIRE AMOUNT SUSPENDED BASED ON FUTURE COMPLIANCE WITH THIS CONSENT ORDER. IN THE EVENT OF A VIOLATION OF THIS ORDER, THE SECURITIES DIVISION WILL SEEK ENFORCEMENT OF THE ORDER AND IMPOSITION OF THE SUSPENDED FINE PURSUANT TO RCW 21.21.395. IT IS FURTHER AGREED AND ORDERED, PURSUANT TO RCW 21.20.110, THAT FOR A PERIOD OF SIX (6) MONTHS FROM THE DATE OF ENTRY OF THIS CONSENT ORDER, RESPONDENT TERRENCE R. SPRAGUE SHALL NOT MAKE APPLICATION FOR NOR BE GRANTED REGISTRATION AS A BROKER-DEALER, INVESTMENT ADVISER, SECURITIES SALESPERSON, OR INVESTMENT ADVISER REPRESENTATIVE."
